INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3608, '江苏中佳建材有限公司', '913213233311288503', 3340499, 5016867, '1016102400241', null, null, '裁判文书', null, '本院于2016年7月21日立案受理了申请人汶上县双盛木业加工厂的公示催告申请，对其遗失的号码为31400051/29280655的一张银行承兑汇票，依法办理了公示催告手续。公示催告期间，无人申报权利。本院于2016年10月21日判决：一、宣告申请人汶上县双盛木业加工厂持有的号码为31400051/29280655，出票金额为50000元，出票日期为2016年2月3日，汇票到期日为2016年8月3日，出票人为江苏中佳建材有限公司，付款行为江苏泗阳农村商业银行营业部，收款人为灌南县天河贸易有限公司的银行承兑汇票无效；二、自本判决公告之日起，申请人汶上县双盛木业加工厂有权向支付人请求支付。', null, '泗阳县人民法院', null, null, null, null, '非公示项', '非公示项', '江苏中佳建材有限公司,灌南县天河贸易有限公司', '汶上县双盛木业加工厂', '<a href=''https://www.tianyancha.com/company/2440527532'' target=''_blank''>江苏中佳建材有限公司</a>,<a href=''https://www.tianyancha.com/company/2352265038'' target=''_blank''>灌南县天河贸易有限公司</a>', '汶上县双盛木业加工厂', '江苏', '2016-10-27', 'G43', null, null, null, '2019-03-22 21:09:15', '2019-03-22 21:09:15', 1, 0);
INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3608, '江苏中佳建材有限公司', '913213233311288503', 3523514, 4798372, '1016072600243', null, null, '公示催告', null, '申请人汶上县双盛木业加工厂以一张银行承兑汇票遗失为由，向本院申请公示催告，本院决定受理，现依法予以公告。该银行承兑汇票号码为31400051/29280655，出票金额为50000元，出票日期为2016年2月3日，汇票到期日为2016年8月3日，出票人为江苏中佳建材有限公司，付款行为江苏泗阳农村商业银行营业部，收款人为灌南县天河贸易有限公司，最后持票人为汶上县双盛木业加工厂。自本公告发布之日起60日内，利害关系人应向本院申报权利，届时若无人申报权利，本院将依法作出判决，宣告上述票据无效。在公示催告期间，转让该张票据权利的行为无效。', null, '泗阳县人民法院', null, null, null, null, '非公示项', '非公示项', '', '', null, null, '江苏', '2016-07-28', '六版', null, null, null, '2019-03-22 21:09:15', '2019-03-22 21:09:15', 1, 0);
