INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3905, '江苏天美新型建材有限公司', '91321323578116704Q', 3338650, 5003854, '1016101800818', null, null, '裁判文书', null, '本院于2016年7月27日立案受理了申请人福建省工业设备安装有限公司的公示催告申请，对其遗失的号码为31400051/28144065的一张银行承兑汇票，依法办理了公示催告手续。公示催告期间，无人申报权利。本院于2016年10月17日判决：一、宣告申请人福建省工业设备安装有限公司持有的号码31400051/28144065，票面金额为100000元，出票人为江苏天美新型建材有限公司，付款行为江苏泗阳农村商业银行营业部，收款人为泗阳县国轩商贸有限公司，出票日期为2016年1月8日，到期日为2016年7月6日的一张银行承兑汇票无效；二、自本判决公告之日起，申请人福建省工业设备安装有限公司有权向支付人请求支付。', null, '泗阳县人民法院', null, null, null, null, '非公示项', '非公示项', '江苏天美新型建材有限公司,泗阳县国轩商贸有限公司', '', '<a href=''https://www.tianyancha.com/company/2358606023'' target=''_blank''>江苏天美新型建材有限公司</a>,<a href=''https://www.tianyancha.com/company/2534469676'' target=''_blank''>泗阳县国轩商贸有限公司</a>', null, '江苏', '2016-10-23', 'G27', null, null, null, '2019-03-22 21:09:38', '2019-03-22 21:09:38', 1, 0);
INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3905, '江苏天美新型建材有限公司', '91321323578116704Q', 3536777, 4809344, '1016072900430', null, null, '公示催告', null, '申请人福建省工业设备安装有限公司以一张银行承兑汇票遗失为由，向本院申请公示催告，本院决定受理，现依法予以公告。该银行承兑汇票号码为31400051/28144065，出票金额为100000元，出票日期为2016年1月8日，汇票到期日为2016年7月6日，出票人为江苏天美新型建材有限公司，付款行为江苏泗阳农村商业银行营业部，收款人为泗阳县国轩商贸有限公司，最后持票人为福建省工业设备安装有限公司。自本公告发布之日起60日内，利害关系人应向本院申报权利，届时若无人申报权利，本院将依法作出判决，宣告上述票据无效。在公示催告期间，转让该张票据权利的行为无效。n', null, '泗阳县人民法院', null, null, null, null, '非公示项', '非公示项', '', '', null, null, '江苏', '2016-08-07', 'G23', null, null, null, '2019-03-22 21:09:38', '2019-03-22 21:09:38', 1, 0);
