INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4022, '江苏庆丰能源有限公司', '913213235737738879', 1384046, 5670330, '1017071301161', '1050', '64', '破产文书', '', '本院根据申请人深圳市东瑞网印器材有限公司的申请于2017年5月18日作出（2017）苏1323破1号民事裁定书，裁定受理江苏庆丰能源有限公司破产清算一案。本院同时作出（2017）苏1323破1号民事决定书，指定江苏雅凯律师事务所担任江苏庆丰能源有限公司管理人。江苏庆丰能源有限公司的债权人应在公告之日起45日内向管理人（管理人办公地点：江苏省沭阳县沭城街道常州路2号，负责人：解兆明，联系电话：**********）申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国企业破产法》规定的程序行使权利。江苏庆丰能源有限公司的债务人或者财产持有人应当向管理人清偿债务或交付财产。本院定于2017年10月11日下午14:30在泗阳县人民法院十二法庭召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的，还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的，还应提交律师事务所的指派函。', null, '泗阳县人民法院', '', '7', '普通', '张梁', '非公示项', '非公示项', '江苏雅凯律师事务所', '无', '江苏雅凯律师事务所', '无', '江苏', '2017-07-18', '三版', '', '', '', '2019-03-22 21:09:44', '2019-03-22 21:09:44', 1, 0);
