INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4072, '江苏恒洪工程建设有限公司', '91321323695465698W', 2391153, 1266780, '201302010535', null, null, '裁判文书', null, '江苏恒洪工程建设有限公司：本院受理原告宿迁市万通公路养护工程有限公司诉被告江苏恒洪工程建设有限公司、倪怀明建设工程施工合同纠纷一案，现已审理终结。因你公司下落不明，依照法律的规定，向你公司公告送达（2012）沭民初字第1944号民事判决书，判决内容如下：一、被告倪怀明于本判决生效后10日内给付原告宿迁市万通公路养护工程有限公司工程款858380元及利息（自2012年4月11日起至本判决确认给付之日止，按中国人民银行同期贷款利率标准计算），被告江苏恒洪工程建设有限公司对上述款项负连带责任；二、驳回原告其他诉讼请求。如果未按本判决指定的期间履行给付义务，应当依照法律的规定，加倍支付迟延履行期间的债务利息。案件受理费12384元，保全费5000元，合计17384元，由原告负担5000元，由被告倪怀明负担12384元。自发出本公告之日起，经过60日即视为送达。如不服本判决，可在判决书送达之日起15日内向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。', null, '沭阳县人民法院', null, null, null, null, '非公示项', '非公示项', '宿迁市万通公路养护工程有限公司', '江苏恒洪工程建设有限公司', '<a href=''https://www.tianyancha.com/company/2351127232'' target=''_blank''>宿迁市万通公路养护工程有限公司</a>', '<a href=''https://www.tianyancha.com/company/2349448543'' target=''_blank''>江苏恒洪工程建设有限公司</a>', '江苏', '2013-02-06', 'G27版', null, null, null, '2019-03-22 21:09:47', '2019-03-22 21:09:47', 1, 0);
