INSERT INTO ENT_COURT_ANNOUNCE_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, TABLE_ID, ANNOUNCE_ID, BLTNNO, BLTNSTATE, BLTNTYPE, BLTNTYPENAME, CASENO, CONTENT, COURTFLAG, COURTCODE, CUSTOMNO, DEALGRADE, DEALGRADENAME, JUDGE, JUDGEPHONE, MOBILEPHONE, PARTY1, PARTY2, PARTY1_STR, PARTY2_STR, PROVINCE, PUBLISHDATE, PUBLISHPAGE, REASON, SHOWTXTDATE, TMPSAVERSN, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4499, '江苏维格新材料科技有限公司', '91321323060166109G', 731398, 4931239, '', '', '', '公示催告', '', '深圳市金彩化工有限公司因一张银行承兑汇票遗失，向本院申请公示催告。本院决定受理。依照《中华人民共和国民事诉讼法》第二百一十九条规定，现予公告。一、公示催告申请人：深圳市金彩化工有限公司。二、公示催告的票据：银行承兑汇票，号码为10500053/22030629，票面金额1000000元，出票人为江苏金之彩集团有限公司，持票人为深圳市金彩化工有限公司，背书人为江苏维格新材料科技有限公司、苏州苏大维格光电科技股份有限公司、上海乘鹰新材料有限公司、上海维凯光电新材料有限公司、湖北宜美特全息科技有限公司，出票日期为2016年5月31日，汇票到期日为2016年11月30日，付款行为中国建设银行泗阳支行，收款人为泗阳华彩包装有限公司。三、申报权利的期间：自公告之日起60日内。四、自公告之日起60日内，利害关系人应向本院申报权利。届时如果无人申报权利，本院将依法作出判决，宣告上述票据无效。在公示催告期间，转让该票据的行为无效。', null, '泗阳县人民法院', '', '', '', '', '非公示项', '非公示项', '。依照《中华人民共和国民事', '', '。依照《中华人民共和国民事', null, '江苏', '2016-09-21', '三版', '', '', '', '2019-03-22 21:10:13', '2019-03-22 21:10:13', 1, 0);
